import React from 'react'
import '../../App.css'
import './Gallery.css';
import img1 from '../../images/gallery-1.jpeg'
import img2 from '../../images/gallery-2.jpeg'
import img3 from '../../images/gallery-3.jpeg'


function Gallery() {
  return (
    <div className='gallery'>
      <ul>
      <li>
        <div className='gallery_line-1'>
          <img src={img1} height={300} width={300}/>
          <img src={img2} height={300} width={300}/>
        </div>
      </li>
      <li>
        <div className='gallery_line-2'>
          <img src={img3} height={300} width={300}/>
        </div>
      </li>
      </ul>
    </div>
  )
}

export default Gallery
